  body {
    margin: 0;
    padding: 20px;
    font-size: 18px;
    font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
    line-height: 1.4;
    color: #fff;
    text-shadow: 0 1px 3px rgba(0,0,0,.5);
  }

  .container {
    max-width: 700px;
    margin: 0 auto;
  }

  h1 {
    margin: 0;
    padding: 5px 0;
    font-size: 200%;
    line-height: 1.1;
  }

  .error-code {
    display: inline-block;
    font-size: 200%;
    font-weight: 200;
    padding: 0 15px;
    margin: 0 10px 20px 0;
    background-color: rgba(0,0,0,.35);
    border-radius: 5px;
    box-shadow: inset 0 1px 2px rgba(0,0,0,.25), 0 1px 0 rgba(255,255,255,.05);
  }

  p {
    margin: 0 0 40px;
    color: rgba(255,255,255,.8);
  }

  a {
    color: #fff;
    font-weight: bold;
    text-decoration: none;
    -webkit-transition: all .1s ease-in-out;
  }
  a:hover {
    text-shadow: 0 0 10px rgba(255,255,255,.5);
  }

  .button {
    padding: 10px 20px;
    font-weight: 500;
    color: #fff;
    text-decoration: none;
    background-color: transparent;
    border: 1px solid rgba(255,255,255,.3);
    border-radius: 4px;
  }
  .button:hover {
    background-color: rgba(255,255,255,.3);
  }

  .octocat {
    position: absolute;
    left: 50%;
    bottom: 0px;
    width: 400px;
    height: 275px;
    margin-left: -200px;
    overflow: hidden;
  }
  .octocat img {
    max-width: 100%;
  }

  /* Hide the octocat when screen is too short */
  @media (min-width: 480px) and (max-height: 700px) {
    .octocat {
      opacity: 0;
    }
  }

  /* Scale the octocat and align the error code */
  @media (min-width: 480px) {
    .container {
      margin-top: 150px;
    }
    .content {
      margin-left: 110px;
    }
    .error-code {
      float: left;
      margin-bottom: 0;
    }
    .octocat {
      width: 600px;
      height: 370px;
      margin-left: -300px;
    }
  }

  /* Change how background is sized for regular and widescreen views */
  @media (min-width: 768px) {
    html {
      background-size: 100% 100%;
    }
  }
  @media screen and (min-width: 1500px) {
    html {
      background-size: 100% auto;
    }
  }
</style>
